-- 创建数据库
-- --------------------------------------------------------

CREATE DATABASE IF NOT EXISTS `nest_db` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;
USE `nest_db`;

-- 数据库结构
-- --------------------------------------------------------

CREATE TABLE `media` (
  `id` int(36) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `poster` varchar(500) NOT NULL,
  `backdrop` varchar(500) NOT NULL,
  `year` int(11) NOT NULL,
  `rating` decimal(3,1) NOT NULL DEFAULT '0.0',
  `genres` json NOT NULL,
  `type` enum('movie','tv') NOT NULL,
  `status` enum('released','upcoming','ongoing') NOT NULL DEFAULT 'released',
  `duration` int(11) DEFAULT NULL,
  `director` varchar(255) DEFAULT NULL,
  `boxOffice` bigint(20) DEFAULT NULL,
  `seasons` int(11) DEFAULT NULL,
  `episodes` int(11) DEFAULT NULL,
  `creator` varchar(255) DEFAULT NULL,
  `network` varchar(255) DEFAULT NULL,
  `cast` json NOT NULL,
  `createdAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `sourceUrl` varchar(255) DEFAULT NULL,
  `isImagesDownloaded` tinyint(1) DEFAULT NULL,
  `views` int(255) DEFAULT NULL,
  `likes` int(255) DEFAULT NULL,
  `translations` json DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1483 DEFAULT CHARSET=utf8;
CREATE TABLE `migrations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `timestamp` bigint(20) NOT NULL,
  `name` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;
CREATE TABLE `tracker_events` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `event_id` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '事件ID',
  `event_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '事件发生时间',
  `user_id` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户ID',
  `session_id` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '会话ID',
  `device_fingerprint` text COLLATE utf8mb4_unicode_ci COMMENT '设备指纹',
  `properties` json DEFAULT NULL COMMENT '事件属性 (JSON格式)',
  `sdk_version` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'SDK版本',
  `app_id` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '应用ID',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_event_user` (`event_id`,`user_id`),
  KEY `idx_session` (`session_id`),
  KEY `idx_event_time` (`event_time`),
  KEY `idx_app_id` (`app_id`),
  KEY `idx_user_id` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='用户行为追踪事件表';
CREATE TABLE `translations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mediaId` int(11) NOT NULL,
  `field` enum('title','description') COLLATE utf8mb4_unicode_ci NOT NULL,
  `language` varchar(2) COLLATE utf8mb4_unicode_ci NOT NULL,
  `value` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UQ_MEDIA_LANG_FIELD` (`mediaId`,`language`,`field`),
  KEY `IDX_MEDIA_LANG_FIELD` (`mediaId`,`language`,`field`),
  CONSTRAINT `FK_TRANSLATION_MEDIA` FOREIGN KEY (`mediaId`) REFERENCES `media` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3601 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `email` varchar(255) NOT NULL,
  `age` int(11) DEFAULT NULL,
  `createdAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_97672ac88f789774dd47f7c8be` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

